When a tooltip is hovered, it checks if it's the active tooltip. If not, it opens the tooltip by calling the `openTooltip` function from the context. When the tooltip is hovered out, it closes the tooltip by calling the `closeTooltip` function.

By wrapping the `Tooltip` components with the `TooltipProvider`, we can share the state of the active tooltip between them, and only one tooltip will be open at a time.

