 The entity is 7 bits long. The arraybuffer will be 1 byte long for every 8 entities (since 7*8=56 and 56/8=7). The packing function should take an array of entities and return an arraybuffer. The unpacking function should take an arraybuffer and return an array of entities.

Here's a simple implementation of the packing and unpacking functions in JavaScript:

```javascript
function packEntities(entities) {
    const arrayBuffer = new ArrayBuffer(Math.ceil(entities.length / 8));
    const uint8Array = new Uint8Array(arrayBuffer);

    let byteIndex = 0;
    let bitIndex = 0;

    for (const entity of entities) {
        // Pack id (4 bits)
        uint8Array[byteIndex] |= (entity.id & 0xF) << bitIndex;

        // Pack size (3 bits)
        uint8Array[byteIndex] |= (entity.size & 0x7) << (bitIndex + 4);

        // Move to the next byte if necessary
        bitIndex += 7;
        if (bitIndex >= 8) {
            bitIndex -= 8;
            byteIndex++;
        }
    }

    return arrayBuffer;
}

function unpackEntities(arrayBuffer) {
    const uint8Array = new Uint8Array(arrayBuffer);
    const entities = [];

    let byteIndex = 0;
    let bitIndex = 0;

    while (byteIndex < uint8Array.length) {
        // Unpack id (4 bits)
        const id = (uint8Array[byteIndex] >> bitIndex) & 0xF;

        // Unpack size (3 bits)
        const size = (uint8Array[byteIndex] >> (bitIndex + 4)) & 0x7;

        entities.push({ id, size });

        // Move to the next byte if necessary
        bitIndex += 7;
        if (bitIndex >= 8) {
            bitIndex -= 8;
            byteIndex++;
        }
    }

    return entities;
}
```

